(2083, 'strong', '强壮的，健壮的；坚固的，结实的；坚定的，坚强的；（感情、观点、信仰等）强烈的，坚定的，不会动摇的；（印象、影响）强烈的，深刻的；（关系）稳固的，持久的，牢固的；有说服力的，强有力的；（成功或发生的）可能性大的；实力强的，有望成功的；健康的，强健的；精通的，擅长的；味重的；强效的；（酒精等主要成分）含量高的，浓的；（光线）强烈的，（色彩）浓重的；（货币）坚挺的，（经济）强劲的，（行业）景气的；明显的；强劲的，高速移动的；众多的；（用于数字后，表示某集体的规模）多达……的；粗鲁的，冒犯的；（语法）（动词）强变化的，强变格的；（语音学）重读的；（物理）强', 'adj', 'strɔːŋ', 'strɒŋ', '["\\u521d\\u4e2d", "\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814"]', 1),
