(1837, 'sand', '沙，沙子；沙堆，沙地；沙滩，沙漠；沙石层，沙层；（尤指大于0.06毫米的沙粒构成的）沉积沙土；沙土色，浅黄灰色；<美，非正式>坚定，刚毅', 'n', 'sænd', 'sænd', '["\\u521d\\u4e2d", "\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814", "GRE"]', 1),
