(1799, 'ring', '戒指，指环；环状物；环状线，圆形印迹；<英>腿环，足环（系在鸟腿上的铝环，供日后识别用）；（体操运动中的）吊环；围成一圈的人（或物）； 圆形表演场（或竞技场）；<英>圆形灶盘，炉头；铃声，钟声；按铃，敲钟；电话铃声；<英，非正式>打电话；清脆响亮声；（尤指教堂的）套钟，编钟；（非法交易或犯罪的）团伙，帮派；拳击比赛，摔跤比赛（the ring）；（言语、声音等的）特性；（天文）行星光环；（树木的）年轮（tree ring 的简称）；环路（ring road 的简称）；（考古）环形护城工事；<非正式>肛门；（化学）环；（数学）环', 'n', 'rɪŋ', 'rɪŋ', '["\\u521d\\u4e2d", "\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814"]', 1),
(1799, 'ring', '包围，围住；<英>绕......画圆，把......圈起来；使成环形；（尤指在动物身上）套环，戴上环套；（使）发出钟声，响起铃声；<英>（给……）打电话；（电话）铃声响；（两耳）鸣响，嗡嗡作响；<文>回响，响彻；听上去（有指明的印象或品质）；充满（ring with）；<非正式>（尤指通过更改车牌号）非法将（汽车）改头换面', 'v', 'rɪŋ', 'rɪŋ', '["\\u521d\\u4e2d", "\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814"]', 1),
(2034, 'spring', '春天，春季；泉，泉水；源泉，根源；弹簧，发条；弹性，弹力；跳，跃；活力，朝气；<罕>一群水鸭；朔望潮，大潮；（船甲板）翘曲，弯曲；（厚木板、圆材的）裂开，裂缝；（航海）倒缆，斜系船缆', 'n', 'sprɪŋ', 'sprɪŋ', '["\\u521d\\u4e2d", "\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814", "IELTS", "TOEFL", "GMAT", "\\u5546\\u52a1\\u82f1\\u8bed"]', 1),
