(2034, 'spring', '跳，跃；突然弹开，突然移动；突然出现，涌现；突然启动，突然运转；突然向某人提供（或提出）；<非正式>帮助……逃跑（或越狱），营救；发源于，来自；<美，非正式>付账（尤指请客）；<古>花钱；<澳，非正式>突然发现，撞见（不正当活动或违法者）；惊起（猎鸟），使（猎鸟）从躲藏处飞出；使爆炸；（尤指木料）翘曲，裂开；（船的桅杆或其他部分）翘曲，裂开', 'v', 'sprɪŋ', 'sprɪŋ', '["\\u521d\\u4e2d", "\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814", "IELTS", "TOEFL", "GMAT", "\\u5546\\u52a1\\u82f1\\u8bed"]', 1),
(1826, 'sack', '麻布（或厚纸、塑料等）大袋；一袋（的量）；<非正式> 解雇（the ~）；<非正式> 床（the ~）；（通常指在战争中）洗劫，劫掠；<非正式>（棒球）垒；（在争球线后对四分卫的）擒杀；宽松直筒连衣裙（=sack dress）；<史>宽松女袍；<史>（流行于18世纪、系于礼服裙裙肩上的）宽褶后拖曳地裙裾；<史>萨克葡萄酒', 'n', 'sæk', 'sæk', '["CET4", "CET6", "\\u8003\\u7814", "IELTS", "\\u5546\\u52a1\\u82f1\\u8bed"]', 1),
(1826, 'sack', '<非正式> 解雇，开除；（军队或军事集团）劫掠，洗劫；（在美式足球中）擒抱（四分卫）；<美，非正式>把……装进袋里；<美，非正式>上床睡觉（~ out）', 'v', 'sæk', 'sæk', '["CET4", "CET6", "\\u8003\\u7814", "IELTS", "\\u5546\\u52a1\\u82f1\\u8bed"]', 1),
