(2281, 'twist', '使弯曲，扭弯；（使）扭曲变形；旋转，转动；扭动身体；扭伤（脚踝等）；编织，捻在一起；盘绕，缠绕；歪曲，曲解；蜿蜒前进，曲折前进；跳扭摆舞；<英，非正式>欺骗，欺诈；牌面朝上', 'v', 'twɪst', 'twɪst', '["\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814", "IELTS", "TOEFL"]', 1),
