(1681, 'race', '赛跑，速度竞赛；竞争，角逐；赛马会（the ~）；人种，种族；民族；（动植物）种，属；（具有共同特征的）一群（或一批）人（或物）；急流；沟槽，通道；<古>血统，门第', 'n', 'reɪs', 'reɪs', '["\\u521d\\u4e2d", "\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814"]', 1),
