(224, 'bean', '豆，菜豆，豆科植物；籽实，豆形种子；用于强调丝毫，一点；<旧>脑袋；（~）描述Java的软件组件模型（Enterprise Java ~）', 'n', 'biːn', 'biːn', '["\\u521d\\u4e2d", "\\u9ad8\\u4e2d", "CET4", "CET6", "\\u8003\\u7814"]', 1),
